import React, { useState } from 'react';
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';
import { useUser } from '../../contexts/UserContext';
import api from '../../services/api';
import { ENDPOINTS } from '../../config/constants';

export default function Profile() {
  const { user, setUser } = useUser();

  const [name, setName] = useState(user?.name || '');
  const [email, setEmail] = useState(user?.email || '');
  const [password, setPassword] = useState('');
  const [healthCondition, setHealthCondition] = useState(user?.health_condition || []);
  const [dietaryPreferences, setDietaryPreferences] = useState(user?.dietary_preferences || []);
  const [message, setMessage] = useState(null);

  const healthOptions = ['Diabetes', 'Heart Disease', 'High Blood Pressure', 'None'];
  const dietaryOptions = ['Vegetarian', 'Vegan', 'Keto', 'Low Carb', 'None'];

  const handleSaveChanges = () => {
    const requestBody = {
      name,
      email,
      health_condition: healthCondition,
      dietary_preferences: dietaryPreferences,
    };

    api({
      url: ENDPOINTS.USER.PROFILE,
      method: 'PUT',
      body: requestBody,
      onSuccess: (data) => {
        setUser(data);
        setMessage('Profile updated successfully!');
      },
      onError: (error) => {
        setMessage(error.message || 'Failed to update profile.');
      },
    });
  };

  const handleChangePassword = () => {
    const requestBody = {
      password,
    };

    api({
      url: ENDPOINTS.USER.AUTH.CHANGE_PASSWORD,
      method: 'POST',
      body: requestBody,
      onSuccess: () => {
        setMessage('Password changed successfully!');
      },
      onError: (error) => {
        setMessage(error.message || 'Failed to change password.');
      },
    });
  };

  return (
    <Container
      className="d-flex flex-column align-items-center justify-content-center"
      style={{
        minHeight: '100vh',
        backgroundImage: `url('/Image/background.svg')`,
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
        padding: '2rem',
      }}
    >
      <Card style={{ width: '100%', maxWidth: '600px', padding: '20px', backgroundColor: 'rgba(255, 255, 255, 0.8)' }}>
        <h3 className="text-center">User Information</h3>
        {message && <p className="text-center" style={{ color: 'green' }}>{message}</p>}
        <Form>
          {/* Name */}
          <Form.Group className="mb-3">
            <Form.Label>Name</Form.Label>
            <Form.Control
              type="text"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
          </Form.Group>

          {/* Email */}
          <Form.Group className="mb-3">
            <Form.Label>Email</Form.Label>
            <Form.Control
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </Form.Group>

          {/* Health Conditions */}
          <Form.Group className="mb-3">
            <Form.Label>Health Conditions</Form.Label>
            <Form.Select
              multiple
              value={healthCondition}
              onChange={(e) => setHealthCondition(Array.from(e.target.selectedOptions, (option) => option.value))}
            >
              {healthOptions.map((option) => (
                <option key={option} value={option}>
                  {option}
                </option>
              ))}
            </Form.Select>
          </Form.Group>

          {/* Dietary Preferences */}
          <Form.Group className="mb-3">
            <Form.Label>Dietary Preferences</Form.Label>
            <Form.Select
              multiple
              value={dietaryPreferences}
              onChange={(e) => setDietaryPreferences(Array.from(e.target.selectedOptions, (option) => option.value))}
            >
              {dietaryOptions.map((option) => (
                <option key={option} value={option}>
                  {option}
                </option>
              ))}
            </Form.Select>
          </Form.Group>

          {/* Save Changes Button */}
          <Button
            onClick={handleSaveChanges}
            style={{ backgroundColor: 'black', border: 'none', marginRight: '10px' }}
          >
            Save Changes
          </Button>
        </Form>

        <hr />

        {/* Change Password */}
        <Form>
          <Form.Group className="mb-3">
            <Form.Label>New Password</Form.Label>
            <Form.Control
              type="password"
              placeholder="Enter new password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </Form.Group>
          <Button
            onClick={handleChangePassword}
            style={{ backgroundColor: 'black', border: 'none' }}
          >
            Change Password
          </Button>
        </Form>
      </Card>
    </Container>
  );
}
